import React from 'react';
import Navbar from '../Home/Navbar';
import Footer from '../Home/Footer'

const About = ( ) => {
    return(
        <>
            <Navbar />
            
            <div className='about_main'>    
                <div className='about'>
                    <div className='about_title'>
                        <h1>About Us</h1>
                    </div>
                </div>
            </div>

            <Footer />
        </>
    )
}

export default About;
